import './App.css';
import { FaTimes} from 'react-icons/fa';

function Todo({todo, onDelete, onCompleted}) {  
  return (
      <div 
      className={`Todo ${todo.completed ? 'Completed' : ''}`} 
      onDoubleClick={() => onCompleted(todo.id)}>
          <tr>
          <td>{todo.title} 
          <FaTimes onClick={() => onDelete(todo.id)} style={{float: 'right'}}/> </td>
          <td> {todo.id} </td>
          </tr>
      </div>
  );
}

export default Todo;
